hljs.registerLanguage(
  "profile",
  (() => {
    "use strict";
    return ({ C_NUMBER_MODE, APOS_STRING_MODE, QUOTE_STRING_MODE }) => {
      return {
        name: "Python profiler",
        contains: [
          C_NUMBER_MODE,
          {
            begin: "[a-zA-Z_][\\da-zA-Z_]+\\.[\\da-zA-Z_]{1,3}",
            end: ":",
            excludeEnd: !0,
          },
          {
            begin: "(ncalls|tottime|cumtime)",
            end: "$",
            keywords: "ncalls tottime|10 cumtime|10 filename",
            relevance: 10,
          },
          {
            begin: "function calls",
            end: "$",
            contains: [C_NUMBER_MODE],
            relevance: 10,
          },
          APOS_STRING_MODE,
          QUOTE_STRING_MODE,
          {
            className: "string",
            begin: "\\(",
            end: "\\)$",
            excludeBegin: !0,
            excludeEnd: !0,
            relevance: 0,
          },
        ],
      };
    };
  })()
);
